    true,nt"url": null,nt"notes": "<p>ESPC development is sponsored by the
    CMS Center for Medicare and Medicaid Innovation in partnership with the Center for
    Medicaid and CHIP Services (CMCS) under the authority of the American Recovery and
    Reinvestment Act of 2009.<br />nThe ESPC database is in a Microsoft (MS) Access
    format and contains Medicaid and CHIP data, for the 50 States and District of Columbia.
     Specifically, The ESPC database predominantly houses information on Medicaid and
    CHIP program characteristics as well as selected environmental factors that are
    available through other publicly available databases.  Program characteristics include
    data elements such as eligibility criteria, the presence of waiver programs, managed
    care penetration, benefit coverage, reimbursement levels, and expenditures.</p>n",nt"license_title":
